import React from "react";
import { BrowserRouter, Route, Routes } from "react-router-dom";
import NavBar from "./Components/NavBar.js";
import NewsList from "./Components/NewsList.js";

function App() {
  return (
    <BrowserRouter>
      <Routes>
      <NavBar />
        <Route
          path="/"
          element={
            <NewsList
              apiUrl="https://newsapi.org/v2/top-headlines?category=technology&q=cybersecurity&apiKey=YOUR_API_KEY"
              itemType="news"
            />
          }
        />
        <Route
          path="/vulnerabilities"
          element={
            <NewsList
              apiUrl="https://services.nvd.nist.gov/rest/json/cves/1.0?resultsPerPage=10"
              itemType="vulnerabilities"
            />
          }
        />
      </Routes>
    </BrowserRouter>
  );
}

export default App;
